const Zines = ({ zines }) => {
  return (
    <div>
      {zines.map((zine, index) => (
        <div key={index}>
          <h2>{zine.title}</h2>
          <p>Author: {zine.author}</p>
          <p>Description: {zine.description}</p>
          <div>
            {zine.images.map((image, imageIndex) => (
              <img
                key={imageIndex}
                src={URL.createObjectURL(image)}
                alt={`Zine ${index + 1} Image ${imageIndex + 1}`}
              />
            ))}
          </div>
        </div>
      ))}
    </div>
  );
};

export default Zines;
